import vector from '../Assets/vector.png';
function App() {
    return (
<div className="App w-[100vw] h-[96vh] flex  gap-[1vh] justify-center  overflow-y-auto">
            <div className="w-[60vw] h-[90vh] bordertest flex flex-col items-center gap-[0.4vw]">
                <img src={vector}></img>
                <p className='abtusheader'>About Us</p>
                <p>Medium length section heading <br></br> goes here</p>
            </div>
      </div>
    );
  }
  
export default App;
